  `file_id` int(11) DEFAULT NULL COMMENT '附件ID',
  `delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除（0未删|1已删）',
  PRIMARY KEY (`id`),
  KEY `工作底稿1` (`draft_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

